import React from 'react';
import { Button, Card, Form, FormInput } from 'shards-react';
import styled from 'styled-components';

const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Forms = styled(Form)`

`;

const Home = () => {
    return (
        <Container style={{ backgroundColor: '#ededed', height: '100vh' }} className="dr-example-container">
            <Card>
                <Forms>
                    <FormInput style={{ marginBottom: 20 }} placeholder="Username" />
                    <Button theme="primary">Secondary</Button>
                </Forms>
            </Card>
        </Container>
    )
}

export default Home;
